FISH ON!!!⁣
In our final Guatemala episode of CAF Life, the boys take to the water in a man vs. fish struggle that would make Hemingway proud (The Old Man and the Sea reference for all you uncultured grunts). Adventure, water, coffee — THIS is what Black Rifle Coffee is all about.⁣
⁣
"Dictator Gesha" was one of the coffees we sourced in Guatemala on that trip — "Gesha" is an incredibly rare, badass coffee — it's not easy to find, but we wrangled some up for y'all. Dictator Gesha is a 91-point, bright-bodied roast with a punchy acidity. It's got tasting notes of jasmine, brown sugar, and grilled peach. It's available now! But not for long, quantities are limited.⁣
